import React from 'react';

const Rank = () => {
    return (
        <div>
            <div className='white f3'>
                {'Piche, your current rank is: '}                
            </div>
            <div className='white f3'>
                {'#5'}                
            </div>
        </div>
    )
}

export default Rank;
